export default class DOMException {
    /**
     * @see https://heycam.github.io/webidl/#es-DOMException-constructor-object
     *
     * @param {string} name
     */
    constructor(name) {
        this._name = name;
        Error.captureStackTrace(this, DOMException);
    }

    /**
     * @type {number}
     * @readonly
     */
    get code() {
        return exceptions[this._name].code || 0;
    }

    /**
     * @type {string}
     * @readonly
     */
    get name() {
        return this._name;
    }

    /**
     * @type {string}
