    };

    const document = node.ownerDocument;

    const parser = new htmlparser.Parser({
        onopentagname(name) {
            const elt = document.createElement(name);
            stack.push(elt);
        },

        onattribute(name, value) {
            last().setAttribute(name, value);
        },

        ontext(text) {
            last().appendChild(document.createTextNode(text));
        },

        onclosetag(name) {
            const elt = stack.pop();
            last().appendChild(elt);
        },

        oncomment(data) {
            last().appendChild(document.createComment(data));
        },
    }, { recognizeSelfClosing: true });
    parser.write(html);
    parser.end();
}

import Node from '../Node';
import Text from '../Text';
import DOMException from '../DOMException';

function cloneElementNode(element, deep) {
    let clone = element.ownerDocument.createElement(element.nodeName);
    clone._ownerDocument = null;
    clone._parentNode = null;
    let attributes = element.attributes;
    for (let key in attributes) {
        if (attributes.hasOwnProperty(key)) {
            clone.setAttribute(key, element.getAttribute(key));
        }
    }

    if (deep) {
        element.childNodes.every((child) => {
            clone.appendChild(cloneAnyNode(child, deep));
            return true;
        });
    }

    return clone;
}

function cloneTextNode(element) {
    return new Text(element.value);
}

/**
 * Function return copy of element and if request deep copy of element
 *
 * @param {ParentNode|Node} element
 * @param {boolean} deep
 * @ignore
 */
function cloneAnyNode(element, deep) {
    switch (element.nodeType) {
        case Node.ELEMENT_NODE:
            return cloneElementNode(element, deep);
        case Node.TEXT_NODE:
            return cloneTextNode(element);
        default:
            throw new DOMException(DOMException.DATA_CLONE_ERR);
    }
}

export {
    cloneAnyNode,
    cloneElementNode,
    cloneTextNode,
};

import escapeHTML from './escapeHTML';

export default function escapeAttribute(string) {
    return escapeHTML(string).replace(/"/g, '&quot;');
}

export default function escapeHTML(string) {
    if (!string) {
        return string;
    }

    return String(string)
        .replace(/&(?!\w+;)/g, '&amp;')
        .replace(/</g, '&lt;')
        .replace(/>/g, '&gt;');
}

import { CssSelectorParser } from 'css-selector-parser';
const cssParser = new CssSelectorParser();

/**
 * querySelectorHelper interface provides simple processing
 * of Element.querySelector method.
 */

/**
 *
 * @param {Element} element
 * @param {string} query
 * @return {Element|null}
 */
export function querySelector(element, query) {
    let rules = cssParser.parse(query);

    const iterator = processElement(element, rules);
    const next = iterator.next();

    if (next && next.value) {
        return next.value;
    }

    return null;
}

/**
  *
  * @param {Element} element
  * @param {string} query
  * @return {Element[]}
  */
export function querySelectorAll(element, query) {
    let rules = cssParser.parse(query);

    const result = [];
    for (let element of processElement(element, rules)) {
        result.push(element);
    }

    return result;
}

/**
 * Function processes one element using current rule
 *
 * @param element
 * @param rules
 * @return {boolean}
 */
function* processElement(element, rules) {
    for (let child of element.children) {
        for (let matchElement of processRules(child, rules)) {
            yield matchElement;
        }

        for (let matchElement of processElement(child, rules)) {
            yield matchElement;
        }
    }
}

/**
 * @param {Element} element
 * @param {Object} rules
 * @return {boolean}
 */
function processRules(element, rules) {
    if (rules.type === 'selectors') {
        return processSelectors(element, rules.selectors);
    } else if (rules.type === 'ruleSet') {
        return processRule(element, rules.rule);
    }
}

/**
 * @param {Element} element
 * @param {Object} rule
 * @return {boolean}
 */
function processRule(element, rule) {
    return processSelectors(element, [{ rule }]);
}

/**
 * @param {Element} element
 * @param {Object[]} selectors
 * @return {boolean}
 */
function* processSelectors(element, selectors) {
    for (let selector of selectors) {
        const rule = selector.rule;

        if (!matchRule(element, rule)) {
            continue;
        }

        if (!rule.hasOwnProperty('rule')) {
            yield element;
            return;
        }

        for (let childMatch of processElement(element, { type: 'ruleSet', rule: rule.rule })) {
            yield childMatch;
        }

        return;
    }
}

function matchRule(element, rule) {
    if (rule.hasOwnProperty('tagName') && element.tagName !== rule.tagName) {
        return false;
    }

    if (rule.hasOwnProperty('classNames')) {
        if (!rule.classNames.every(name => element.classList.contains(name))) {
            return false;
        }
    }

    if (rule.hasOwnProperty('attrs')) {
        if (!rule.attrs.every(attr => {
            switch (attr.operator) {
                case undefined:
                    return element.hasAttribute(attr.name);
                case '=':
                    return element.getAttribute(attr.name) === attr.value;
                default:
                    throw new Error('Unsupported attribute operator ' + attr.operator);
            }
        })) {
            return false;
        }
    }

    return true;
}
